import React, { Component } from "react";

class Clock extends Component {
  state = {
    date: new Date(),
  };

  componentDidMount() {
    this.state = setInterval(() => this.setState({ time: Date.now() }), 1000);
  }

  render() {
    return <h1>test</h1>;
  }
}

export default Clock;
